import React from 'react';
import moment from 'moment';
import { Link } from 'react-router-dom';

const ProjectSummary = ({project,onEditMessage,onRemoveMessage}) => {
    return (
        <div className="card z-depth-0 project-summary">
                <div className="card-content grey-text text-darken-3">
                    <span className="card-title">{project.startTime} {project.endTime}</span>
                    <p>{project.authorFirstName} {project.authorLastName}</p>
                    <p className="grey-text">{moment(project.createdAt.toDate().toString()).calendar()}</p>
                </div>  
                <button onRemoveMessage={onRemoveMessage}></button> 
                <button onEditMessage={onEditMessage}></button> 
            </div>
    )
}

export default ProjectSummary;
